import React from 'react'
import {connect} from 'react-redux'


class Destinations extends React.Component {

    renderDestinations = () => {
        return this.props.destinations.map(destination => (
          <p onClick={() => this.props.removeDestination(destination)}>Name: {destination.name} | Age: {destination.age} | Avg Grade: {destination.grade}</p>
        ))
      }

    render() {
        return (
            <div>
                Places I've Traveled To
                {console.log(this.props.destinations)}
                {this.renderDestinations()}
           
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {destinations: state.destinations}
}

export default connect(mapStateToProps)(Destinations)
